INSERT INTO `feedbacks` VALUES (2,234,'Paul is amazing!Instructors are great and patient. Location is convenient! I am recommending this to my colleagues!',1,1,'This class was wonderful. I definitely will be recommending this to my colleagues','Invoicing ','N/A-Everything was useful',5,5,5,5,5,'No Need to Improve','Instructors are great and patient. Location is convenient!',1,1,'2012-09-05 16:09:19','2012-12-16 18:44:22'),(3,267,'Very informative. Learned many new things to do with powerpoint ',1,1,'Great class! Encouraged to ask questions and love that its very hands on. ','Everyone has their own work station ','no complaints ',5,4,5,5,5,'none ','Convenient location, small classes and informative instructors ',1,1,'2012-10-01 15:15:57','2013-01-22 17:14:59'),(4,274,'Eugenio is such a patient teacher! He is so knowledgeable and always providing tips and tricks for the class. Very fun and very flexible with his teaching.',1,1,'Eugenio is a great teacher. I enjoyed the class.','Everything was useful','N/A',5,5,5,5,5,'N/A','Teachers are great and location is accessible. ',1,1,'2012-10-02 15:55:30','2013-01-25 21:35:36'),(5,275,'Anthony was great! I learned alot from the class for my job. Very patient and always answering questions.',1,1,'Great Class','Pivot Tables','N/A',5,5,5,5,5,'N/A','Reviews are great and location is convenient',1,1,'2012-10-05 14:57:52','2013-01-25 21:35:37'),(6,107,'Anthony is a great instructor. He is very knowledgeable and answered all questions. He takes times to work with all the students and their questions.',1,1,'Great Class','Charts','N/A',5,5,5,5,5,'N/A','Great location, great reviews',1,1,'2012-10-08 15:41:38','2013-01-25 21:35:38'),(7,105,'Anthony is a great teacher! He is very patient and takes his time with everyone. He made the class very fun and was very knowledgeable.',1,1,'Interactive class with lots of hands on exercises','Database Setup','N/A',5,5,5,5,5,'N/A','Location and recommended',1,1,'2012-10-08 17:54:21','2013-01-25 21:35:38'),(8,182,'Scott was a great instructor. He provides alot of real life examples tied in to the lessons. He is very thorough and answered all our questions with tips.',1,1,'The class was great and i cant wait to take this to work','Multiple Master Slides','N/A',5,5,5,5,5,'N/A','They get great reviews',1,1,'2012-10-10 18:38:14','2013-01-22 17:15:00'),(9,291,'Marco was a great teacher! Answered all the questions i had from my last class.  ',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'N/A',NULL,1,1,'2012-10-12 14:22:40','2013-01-25 21:35:40'),(10,275,'Anthony was a great instructor. He mixes the lessons with real life examples. ',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'n/a',NULL,1,1,'2012-10-16 17:32:28','2013-01-25 21:35:41'),(11,108,'Anthony was fantastic. He was so knowledgeable and patient and full of tips and tricks! Definitely coming back again.',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'N/A',NULL,1,1,'2012-10-19 16:26:56','2013-01-25 21:35:41'),(12,108,'This Excel class was great. Anthony is a fun and patient teacher who took his time with everyone and provided lots of knowledge. Just the class I was looking for!',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'N/A',NULL,1,1,'2012-10-19 16:29:28','2013-01-25 21:35:42'),(13,108,'This Excel class is great. A good pace and Anthony takes his time to answer everyone\'s questions. He is very patient and made sure that everyone moved together at the same pace.',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'N/A',NULL,1,1,'2012-10-19 16:33:45','2013-01-25 21:35:43'),(14,255,'Paul is a wonderful instructor. He took the time to answer all my questions and tied many real life experiences to the lessons.',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'N/A',NULL,1,1,'2012-10-19 19:01:11','2012-12-16 18:44:24'),(15,238,'Paul is a great teacher. You can tell he enjoys what he does by the way he teaches. He is very thorough and takes his time to help everyone and answer their questions.',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NU