INSERT INTO `profiles` VALUES (1,30,'Excel & VBA, PowerPoint, SharePoint, Outlook, Dreamweaver, Photoshop, HTML & CSS3','Bio Test\r\n\r\nJoe Tandle has served as the Director of Training of Computer Training Schools in Upstate New York, Long Island, Brooklyn, and Manhattan. He has taken his experiences as an expert trainer and Director of Training and found a happy home at NYIM for the last 9 years. Joe is adamant about using a hands-on training methodology. He approaches computer training from a practical knowledge that coincides with the current software trends and workflow processes of New York Citys most prominent companies.\r\n\r\n\r\nAs a professional computer trainer, it is an invaluable experience to be working hand in hand with such a large cross section of New York. It really puts practical knowledge into perspective and allows us to bring a broad and deep knowledge to the training session. \r\n\r\n\r\nIt is common for the participants in his class to walk out of class with a satisfied feeling of learning something useful,  a smile on their face, as well as a pocket full of personal and business contacts. Some of Joe\'s favorite clients\' have been The Executive Office of the President of the United States, Microsoft, and his grandmother. He has traveled doing volunteer career and computer training with high-risk children in Kenya, Dominican Republic, Ecuador, Guatemala and El Salvador.\r\n\r\nJoe teaches and is certified in: Word, Excel, PowerPoint, Publisher, Outlook, Access, Dreamweaver, Flash, Photoshop, Illustrator, HTML, CSS, Accessibility, Reason, Intro to PC\'s and FileMaker Pro. \r\n\r\n','2011-09-12 22:20:31','2011-12-21 23:55:20'),(2,70,'Fashion Software, Illustrator, Photoshop','','2011-11-14 19:37:42','2011-11-14 19:37:42'),(3,71,'InDesign Essentials, Advanced InDesign, Creating Ebooks Using InDesign CS5.5','','2011-11-14 19:54:33','2011-11-14 19:54:33'),(4,72,'Photoshop, Expert Photoshop, InDesign, Flash, Illustrator, Dreamweaver','','2011-11-14 20:19:02','2012-07-25 15:58:51'),(5,29,'Excel, Advanced Excel, Excel VBA, Financial Modeling, Access','','2011-11-16 16:15:09','2011-11-16 16:15:09'),(6,28,'Excel, PowerPoint, Outlook, Access','','2011-11-18 21:31:13','2011-12-21 23:52:25'),(7,34,'Dreamweaver, WordPress, Photoshop, HTML & CSS3, PowerPoint, Excel','','2011-11-21 18:39:53','2012-11-15 16:42:27'),(8,31,'Fashion Software, Illustrator, Photoshop','','2011-11-21 18:40:32','2011-12-21 23:57:15'),(9,32,'Advanced Quickbooks, Peachtree, Netbooks, Accounting','','2011-11-21 18:40:47','2011-12-21 23:56:45'),(10,33,'SPSS, Adv Statistics','','2011-11-21 18:40:59','2011-12-21 23:56:01'),(11,94,'PowerPoint, Keynote, Quark XPress, Photoshop, InDesign, Dreamweaver','','2012-07-05 17:50:05','2012-07-05 17:50:05'),(12,95,'Basic Excel, Advanced Excel, Financial Modeling, Basic PowerPoint, Advanced PowerPoint','','2012-07-25 15:54:41','2012-07-25 15:57:45');
