INSERT INTO `testimonials` VALUES (1,NULL,NULL,NULL,'Testimonials','Abbreviated Name','Abbreviated Name','Class',0,1,'2011-11-10 18:37:11','2011-11-14 20:29:25',0),(2,30,5,NULL,'I recently had a private training session with Joe Tandle from NYIM.  The overall experience was great.  I feel the instructor was well educated on the tools I needed in order to succeed in my current role.  The pace of the class was wonderful.  It allowed me to ask thoughtful questions on ambiguous material and in return the answers were clear and concise.  The instructor was well- prepared.  He also supplied me with supporting documentation to use at all times.  He even went so far as to provide me the opportunity to call him at anytime in the future if I ever ran into a problem.  Overall, I would rate the preparation, use of time, knowledge of material and general kindness as one of the best training classes/sessions that I have ever attended.  I have and will continue to recommend Joe Tandle and the folks at NYIM to others.','K. Burton of Microsoft Corp.','K. Burton of Microsoft Corp.','Excel and PowerPoint Private Training',1,1,'2011-11-10 18:37:11','2011-12-27 16:55:36',1),(3,30,11,NULL,'The instructor was very helpful. He really knows his PowerPoint. I feel that I got the attention I needed. I think it\'s wonderful to have a smaller class because that way the instructor has more time to spend with the student. NYIM is the BEST place to take computer classes. I was very impressed with this PowerPoint class.HOORAY!!!! Whatever didn\'t register in my head is written in black and white in the manual. This makes things more easier for the student. I NEVER had any connection with PowerPoint but today\'s class has given me a better perspective.','A.G.','A.G.','PowerPoint 2007 for Business Group Class',1,1,'2011-11-10 18:37:11','2011-12-27 18:20:47',1),(4,30,5,NULL,'Joe is extremely knowledgeable of excel and can TEACH the material. I loved this class; Joe and five of us. Very intimate, that is what I paid for. His knowledge of excel taught to me and my classmates was great because we all had something to add. I even brought up this class on a job interview. Very satisfied!!!','K.B.','K.B.','Advanced Excel 2003 for Business Group Class',1,1,'2011-11-10 18:37:11','2011-12-27 19:10:43',0),(5,72,32,NULL,'Eugene was a wonderful teacher. The pace of the class was great; when someone didn\'t understand anything he took the time to fully explain it until everyone got it...no one should feel left behind in his class. I feel like I will walk out of this with the skills/knowledge that I was looking for. I highly recommend taking these classes.','J.F.','J.F.','Flash Essentials Group Class',1,1,'2011-11-10 18:37:11','2011-12-27 18:21:30',0),(6,31,17,NULL,'Mikelle was fantastic. She answered all questions in depth, until every class member understood. She went beyond the distance to help advise us for tasks we have at work.','C.H.','C.H.','Photoshop & Illustrator for the Fashion Industry Group Class',1,1,'2011-11-10 18:37:11','2011-12-27 18:56:04',0),(7,34,11,NULL,'Having participated in a private training session for myself and co-worker as opposed to a group setting I found it to be personal and extremely helpful. I didn\'t feel as if I were lost as can be the case when part of a group. Our instructor, Scott had an excellent knowledge of the material he presented. He was very professional and patient. I would recommend him for any who are interested in PowerPoint training. I appreciated that he was willing to go over the basics in PowerPoint as a refresher before moving to the advanced version.','C.J.','C.J.','Excel for Business 2003 Private Training',1,1,'2011-11-10 18:37:11','2011-12-27 18:22:37',1),(8,30,11,NULL,'Joe was wonderful and really knowledgeable. He also made sure to keep closely in touch with each student\'s progress as the training progressed.','Global Health Strategies','Global Health Strategies','PowerPoint 2007 Private Training',1,1,'2011-11-10 18:37:11','2011-12-27 19:11:57',0),(9,34,1,NULL,'Scott is a really good instructor. One can already tell he\'s very very knowledgeable about the software he\'s teaching about. ','C.A.','C.A.','Excel 2007for Business Group Class',1,1,'2011-11-10 18:37:11','2011-11-11 02:09:42',0),(10,28,6,NULL,'Anthony\'s mastery of Excel and ability to pace teaching to the student\'s experience (or lack of) in Excel allows each student to grasp concepts and make connections to daily work practice regardless of industry. Anthony is an excellent teach and highly recommend him to other students. THANK YOU!','D.I.','D.I.','Excel for Business Group Class',1,1,'2011-11-10 18:37:11','2011-11-11 02:10:01',0),(11,30,33,NULL,'Our instructor Joe was very good; he answered all of our questions, and really took time with each person to handle their questions and stumbling blocks. The CSS part: it is really going to help me with my business, and my ability to help clients create consistent styles for their websites. The small class size helped: only 5 of us, so we all got our questions answered.','N.A.','N.A.','Dreamweaver Essentials 3 dayGroup Class',1,1,'2011-11-10 18:37:11','2011-12-27 18:19:57',0),(12,30,6,NULL,'We all are in agreement - we loved Joe. Personable and very easy to follow. What a great experience. We did gain all we needed to know.','R. H. of Strategic Insight.','R. H. of Strategic Insight.','Advanced Excel 2007 Private Training',1,1,'2011-11-10 18:37:11','2011-11-14 20:30:20',0),(13,33,34,NULL,'Paul was a very good tutor. He covered the topics in the book and those of importance to us, which were not sometimes in the book. He was attentive to our needs and keep the class engaged through out the training. Overall, it was a good experience.','K.O.','K.O.','Flash Essentials 3 day Group Class ',1,1,'2011-11-10 18:37:11','2011-11-18 01:30:54',0),(14,30,33,NULL,'Joe was very knowledgeable &, accessible. Listened. Made sure each student understood the material well. Patient. Explained everything well.','A.S.','A.S.','Dreamweaver Esentials 3Day Group Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:30:22',0),(15,32,23,NULL,'I loved Paul! He was great, very friendly, very clear, dealt exactly with issues that would face my company. Between Arlene (client manager) and Paul, working with NYIM, as been amazing. Arlene was always quick to answer my emails and questions, and Paul was exactly what we needed. Being a small business owner I really appreciate good service.','A.C.','A.C.','QuickBooks private training',1,1,'2011-11-10 18:37:11','2011-11-18 01:31:16',0),(16,30,1,NULL,'The session with Joe was very useful, I now have a spreadsheet that not only works extremely well for my needs, but is also one I finally really understand.  :)','D.C.','D.C.','Excel for Business Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:31:30',0),(17,29,9,NULL,'I don\'t even know what else Saba could have done to make the class better - she was so on point and really interesting. ','L.P.','L.P.','Excel for Mac 2008 private training',1,1,'2011-11-10 18:37:11','2012-09-11 13:41:23',1),(18,34,19,NULL,'Scott is a very good communicator on going over the items on Photoshop','T.Z.','T.Z.','Advanced Excel for Business Group Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:35:56',0),(19,28,11,NULL,'Anthony had good sense of humor & was able to keep the class moving. Very hands on with the entire class. The class was fantastic.','J. T.','J. T.','Photoshop Esentials 2Day Group Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:36:17',0),(20,30,3,NULL,'Joe was excellent at moving through a lot of information while still stopping to make sure I understood. He was very good at conveying the information.','D.E.','D.E.','Excel 2003 for Business Group Class',1,1,'2011-11-10 18:37:11','2011-11-14 20:52:06',0),(21,31,17,NULL,'Mikelle was great so great! Upbeat and very insightful. I have taken these courses before and how she made the information relative to what I am doing in the fashion industry was very helpful','K.G.','K.G.','InDesign Essentials Group Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:36:50',0),(22,34,14,NULL,'I thought Scott was great. I would definitely take a class with him again.','M.R.','M.R.','Photoshop and Illustrator for Fashion Industry Private Training',1,1,'2011-11-10 18:37:11','2011-11-18 01:37:19',0),(23,30,5,NULL,'Joe was an excellent instructor who used real life examples to make the class interesting and helped me follow along. I can\'t say enough good things about this class especially since I had no experience with Excel before this class.','S.S.','S.S.','Advanced PowerPoint 2003 for Business Group Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:37:49',0),(24,30,9,NULL,'Thank you for the session! It was really helpful and I\'ve learned a lot from Joe.','N.N.','N.N.','Excel for Business Group Class',1,1,'2011-11-10 18:37:11','2011-11-18 01:38:06',0),(25,34,11,NULL,'The instructor (Scott) was very professional, went at the right pace, and could answer almost any question that was asked.','Rosetta.','Rosetta.','Advanced Excel private training ',0,1,'2011-11-10 18:37:11','2011-12-22 16:54:13',0),(26,28,1,NULL,'Anthony was very good. He presented the concepts and demonstrated at the same time which was very effective. There was plenty of time to absorb and ask questions.','E.K.','E.K.','Excel for Business Group Class ',0,1,'2011-11-10 18:37:11','2011-12-22 18:07:58',0),(27,31,16,NULL,'She (Mikelle) was VERY helpful and knowledgable in all areas in the programs.','G.O.','G.O.','PowerPoint 2003 for Business Group Class',0,1,'2011-11-10 18:37:11','2011-12-22 16:54:43',0),(28,31,17,NULL,'Mikelle is an excellent instructor. I have had experience with instructors in the past where they were not fully confident with the program. I got the impression that Mikelle knew all aspects of the program.','J.Y.','J.Y.','Photoshop & Illustrator for the Fashion Industry private training',1,1,'2011-11-10 18:37:11','2011-12-22 18:21:07',0),(29,32